import ReactDOM from 'react-dom/client';
import "./styles.css"
import { Link } from 'react-router-dom';
import axios from "axios"
try{
    const response=await axios.get("http://localhost:3001/getproducts",async (req,res)=>{
    
})
}catch(error){
    console.log(error);
}

function Brand(){
    return (
    <section id='brand'>
        <div className='shopbrand'>
                <div className='brand'>
                <Link to="/nikon">
                    <div className="nikon">
                        <img className='brand1' src="./images/nikon.png"/>
                        <div className='nik'><h4>NIKON</h4></div>
                    </div>
                </Link>
                <Link to="/canon">
                    <div className='canon'>
                        <img className='brand2' src="./images/canon.jpg"/>
                        <div className='can'><h4>CANON</h4></div>
                    </div>
                </Link>
                <Link to="/sony">
                    <div className='sony'>
                        <img className='brand3' src="./images/sony.jpg"/>
                        <div className='son'><h4>SONY</h4></div>
                    </div>
                </Link>
                <Link>
                    <div className='fujifilm'> 
                        <img className='brand4' src="./images/fujifilm.png"/>
                        <div className='fuji'><h4>FUJIFILM</h4></div>
                    </div>
                </Link>
                </div>
                
        </div>
    </section>
    )
}
export default Brand;
